import { createSlice } from "@reduxjs/toolkit";
import axios from "axios";

const initialState = {
  searchTerm: "",
  searchCategory: "",
  searchResult: "",
  isSearched: false,
};

export const searchSlice = createSlice({
  name: "searchSlice",
  initialState,
  reducers: {
    isSearched: (state) => {
      state.isAuthenticated = true;
    },
    notSearched: (state) => {
      state.isAuthenticated = false;
    },
  },
});
